import React from 'react';
import {
  Text,
  ScrollView,
  SafeAreaView,
} from 'react-native';
import styled from 'styled-components/native';


export default function LoginScreen() {
  return (
    <SafeContainer>
      <ScrollContainer>
        <Text styles={{ fontSize: 100 }}>This is Login screen!</Text>
      </ScrollContainer>
    </SafeContainer>
  );
}


const SafeContainer = styled.SafeAreaView`
  width: 100%;
  height: 100%;
`;

const ScrollContainer = styled.ScrollView`
  width: 100%;
  height: 100%;
`;
